import Link from "next/link";
import Style from "../components/Style";

const Navbar = () => (
  <div id="linkGroup">
    <div className="link">
      <Link href="/">Home</Link>
    </div>
    <div className="link">
      <Link href="/about">About</Link>
    </div>
    <div className="link">
      <a href="/Services">Services</a>
    </div>
  </div>
);

export default Navbar;
